import React  from 'react';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { Navbar } from './Components/Navbar/Navbar'; // Import Navbar
import { LoginSignup } from './Pages/LoginSignup'; // Import LoginSignup
import Cart from './Pages/Cart'; // Import Cart
import { Product } from './Pages/Product'; // Import Product
import Admin from './Pages/Admin'; // Corrected to default import
import Anklets from './Pages/Anklets';
import Wishlist from './Pages/Wishlist';

const App = () => {
  return (
    <BrowserRouter>
      <Navbar /> {/* Cart count is handled in Navbar via CartContext */}
      <Routes>
        <Route path="/anklets" element={<Anklets />} />
         <Route path="/wishlist" element={<Wishlist/>}/>
       <Route path="/cart" element={<Cart />} />
        <Route path="/login" element={<LoginSignup />} />
        <Route path="/product/:productId" element={<Product />} />
        <Route path="/admin" element={<Admin />} />




      </Routes>
    </BrowserRouter>
  );
};


export default App;
